#define GAMBATTE_GBC_COLOR_CORRECTION_INFO_0_ES                                \
  "Ajusta los colores de la salida de vídeo para que se asemejen a los del "  \
  "hardware real de una Game Boy Color. «Solo para GBC» hace que solo se "   \
  "aplique la corrección al ejecutar juegos de Game Boy Color o al utilizar " \
  "una paleta de Game Boy Color para colorear un juego de Game Boy. "          \
  "«Siempre» aplicará la corrección de color a todos los contenidos, "     \
  "produciendo resultados inesperados o deficientes al utilizar las paletas "  \
  "internas de GB o SGB."
#define OPTION_VAL_GBC_ONLY_ES "Solo para GBC"
#define OPTION_VAL_ALWAYS_ES "Siempre"
#define GAMBATTE_GBC_COLOR_CORRECTION_MODE_LABEL_ES                            \
  "Modo de corrección de color"
#define GAMBATTE_GBC_COLOR_CORRECTION_MODE_INFO_0_ES                              \
  "Especifica el método que se utilizará para corregir el color. «Preciso» "  \
  "producirá una imagen casi indistinguible de la pantalla LCD de una Game "     \
  "Boy Color real. «Rápido» se limitará a oscurecer los colores y a reducir " \
  "la saturación. La opción «Rápido» puede utilizarse en hardwares de gama " \
  "baja si la opción «Preciso» es demasiado lenta."
#define OPTION_VAL_ACCURATE_ES "Preciso"
#define OPTION_VAL_FAST_ES "Rápida"
