#define GAMBATTE_GBC_FRONTLIGHT_POSITION_INFO_0_ES                                \
  "Simula la respuesta física del panel LCD de una Game Boy Color cuando es "    \
  "iluminado desde distintos ángulos. «Centrada» representa la reproducción " \
  "de color estándar. «Por encima de la pantalla» aumenta su brillo y «Por "  \
  "debajo de la pantalla» lo disminuye. Este ajuste se aplicará únicamente "   \
  "cuando el modo de corrección de color esté configurado como «Preciso»."
#define OPTION_VAL_CENTRAL_ES "Centrada"
#define OPTION_VAL_ABOVE_SCREEN_ES "Por encima de la pantalla"
#define OPTION_VAL_BELOW_SCREEN_ES "Por debajo de la pantalla"
