#define GAMBATTE_GBC_COLOR_CORRECTION_LABEL_FR "Correction colorimétrique"
#define GAMBATTE_GBC_COLOR_CORRECTION_INFO_0_FR                                  \
  "Ajuste les couleurs de sortie pour correspondre à l'affichage du matériel " \
  "réel de la Game Boy Color. 'GBC uniquement' garantit que la correction "     \
  "n'est appliquée que lorsque vous jouez à des jeux Game Boy Color, ou "      \
  "lorsque vous utilisez une palette de Game Boy Color pour coloriser un jeu "   \
  "Game Boy. 'Toujours' applique la correction colorimétrique sur tous les "    \
  "contenus, et produira des résultats inattendus/sous-optimaux lors de "       \
  "l'utilisation des palettes de couleurs internes 'GB' ou 'SGB'."
#define OPTION_VAL_GBC_ONLY_FR "GBC uniquement"
#define OPTION_VAL_ALWAYS_FR "Toujours"
#define GAMBATTE_GBC_COLOR_CORRECTION_MODE_LABEL_FR                            \
  "Mode de correction colorimétrique"
#define GAMBATTE_GBC_COLOR_CORRECTION_MODE_INFO_0_FR                             \
  "Spécifie la méthode utilisée lors de la correction colorimétrique. "      \
  "'Précis' produit une sortie presque indifférenciable d'un vrai panneau "    \
  "LCD de Game Boy Color. 'Rapide' ne fait qu'obscurcir les couleurs et "        \
  "réduit la saturation, et peut être utilisé sur du matériel bas de gamme " \
  "si la méthode 'Précis' est trop lente."
#define OPTION_VAL_ACCURATE_FR "Précis"
#define OPTION_VAL_FAST_FR "Rapide"
#define GAMBATTE_GBC_FRONTLIGHT_POSITION_LABEL_FR                              \
  "Correction colorimétrique - Position de l'éclairage avant"
#define GAMBATTE_GBC_FRONTLIGHT_POSITION_INFO_0_FR                               \
  "Simule la réponse physique du panneau LCD de la Game Boy Color lorsqu'il "   \
  "est illuminé sous différents angles. 'Centrale' représente la "            \
  "reproduction standard des couleurs. 'Au-dessus de l'écran' augmente la "     \
  "luminosité. 'En dessous de l'écran' réduit la luminosité. Ce paramètre " \
  "s'applique uniquement lorsque le 'Mode de correction colorimétrique' est "   \
  "réglé sur 'Précis'."
#define OPTION_VAL_CENTRAL_FR "Centrale"
#define OPTION_VAL_ABOVE_SCREEN_FR "Au-dessus de l'écran"
#define OPTION_VAL_BELOW_SCREEN_FR "En dessous de l'écran"
#define GAMBATTE_DARK_FILTER_LEVEL_LABEL_FR                                    \
  "Niveau du filtre d'assombrissement (%)"
#define GAMBATTE_DARK_FILTER_LEVEL_INFO_0_FR                                       \
  "Active la réduction de l'éclairage basée sur la luminosité. Peut être "    \
  "utilisé pour éviter l'éblouissement/fatigue des yeux lorsque vous jouez à " \
  "des jeux avec des fonds blancs, qui sont destinés à être affichés sur une " \
  "Game Boy Color non-rétroéclairée et peuvent donc apparaître "               \
  "inconfortablement lumineux lorsqu'ils sont vus sur un écran rétro-éclairé " \
  "moderne."
#define GAMBATTE_MIX_FRAMES_LABEL_FR "Mélange d'inter-trames"
#define GAMBATTE_MIX_FRAMES_INFO_0_FR                                            \
  "Simule les effets de rémanence LCD, 'Simple' effectue un mélange à 50/50 " \
  "des images actuelles et précédentes. 'Rémanence LCD' imite le temps de "   \
  "réponse naturel du LCD en combinant plusieurs images mises en mémoire "     \
  "tampon. Un mélange 'Simple' est nécessaire lorsque vous jouez à des jeux " \
  "qui dépendent de la rémanence LCD pour des effets de transparence (Wave "   \
  "Race, Ballistic, Chikyuu Kaihou Gun ZAS...)."
#define OPTION_VAL_MIX_FR NULL
#define OPTION_VAL_LCD_GHOSTING_FR "Rémanence LCD (réaliste)"
#define OPTION_VAL_LCD_GHOSTING_FAST_FR "Rémanence LCD (rapide)"
#define GAMBATTE_AUDIO_RESAMPLER_LABEL_FR "Ré-échantillonneur audio "
#define GAMBATTE_AUDIO_RESAMPLER_INFO_0_FR                                           \
  "Spécifie quel algorithme utiliser lors du rééchantillonnage du son généré " \
  "(le débit audio de la Game Boy est limité uniquement par la vitesse "           \
  "d'écriture du processeur, de telle sorte que les fréquences 'natives' "         \
