/* RETRO_LANGUAGE_PT_BR */

#define GAMBATTE_GB_COLORIZATION_LABEL_PT_BR "Colorização do GB"
#define GAMBATTE_GB_COLORIZATION_INFO_0_PT_BR                                     \
  "Ativa a coloração de jogos de Game Boy. \"Automática\" seleciona a paleta " \
  "mais colorida/adequada. \"GBC\" seleciona a paleta de Game Boy Color "         \
  "especifica do jogo caso exista, senão existir, \"GBC — Verde Escuro\". "    \
  "\"SGB\" seleciona a paleta de Super Game Boy especifica do jogo caso "         \
  "exista, senão existir, \"SGB — 1A\". \"Interna\" usa a configuração "     \
  "\"Paleta interna\". \"Personalizada\" carrega a paleta personalizada no "      \
  "diretório do sistema."
#define OPTION_VAL_AUTO_PT_BR "Automática"
#define OPTION_VAL_GBC_PT_BR NULL
#define OPTION_VAL_SGB_PT_BR NULL
#define OPTION_VAL_INTERNAL_PT_BR "Interna"
#define OPTION_VAL_CUSTOM_PT_BR "Personalizada"
#define GAMBATTE_GB_INTERNAL_PALETTE_LABEL_PT_BR "Paleta interna"
#define GAMBATTE_GB_INTERNAL_PALETTE_INFO_0_PT_BR                                  \
  "Define a paleta usada para a coloração dos jogos de Game Boy quando a "       \
  "\"Coloração do GB\" é configurada como \"Interna\", ou é configurada como " \
  "\"Automática\" e o jogo não tem uma paleta de SGB/GBC predefinida.\nAs "      \
